import styled from "styled-components";

export const Container = styled.table`
    padding: 5rem;
    max-width: 1120px;
    display: flex;
    justify-content: center;
    background-color: blue;

    table
    tbody {
        background: var(--shape);
    }

    tbody tr {
        padding: 1rem;
    }
`
